import React, { Component } from 'react'

export default class Navbar extends Component {
  render() {
    return (
      <div class="nav-bar">
        <div>
            <h1 class="movie-app">Movie App</h1>
        </div>
        <div>
            <h2 class="fav">Favoriots</h2>
        </div>
      </div>
    )
  }
}
